import React from 'react';
import './Header.css';

function Header() {
  return (
    <header>
      <div className="logo">Logo</div>
      <h1 className="title">TEAM TREES</h1>
      <p className="quote">"The best time to plant a tree was 20 years ago. The second-best time is now."</p>
      <model-viewer alt="3d model" src="../assets/final_island_2.glb" camera-controls></model-viewer>
      <model-viewer
          // className="model-viewer"
          src="./M08.glb"
          alt="A rock"
          exposure="0.008"
          camera-controls
          ar
          ar-modes="webxr"
          ref={(ref) => {
            modelRef.current = ref;
          }}
        >
        </model-viewer>
    </header>
  );
}

export default Header;
